class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            result: 0,
            previous: []
        }

    }

    render() {
       return(
       <div className="App">
            <input className="result" type="text" value={this.state.result} />
        </div>
       )

    }
}

export default App;
